css:
.conflict-resolved {
  background: rgba(255, 255, 255, 0.2);
}
.conflict-ours {
  background: rgba(79, 153, 211, 0.4);
}
.conflict-ours.cursor-line {
  background: rgba(79, 153, 211, 0.3);
}
.conflict-theirs {
  background: rgba(159, 202, 86, 0.4);
}
.conflict-theirs.cursor-line {
  background: rgba(159, 202, 86, 0.3);
}
.conflict-dirty {
  background: rgba(220, 205, 105, 0.4);
}
.conflict-dirty.cursor-line {
  background: rgba(220, 205, 105, 0.3);
}
